// App.js

import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Blog from './components/Blog';
import Gallery from './components/Gallery';
import Header from './components/Header';
import HeritageSites from './components/HeritageSites';
import Home from './components/Home';
import OurPride from './components/Ourpride';
import TravelWithUs from './components/TravelWithUs';
import SignUp from './components/SignUp';
import SignIn from './components/SignIn';
import StateList from './components/StateList';
import StateDetails from './components/StateDetails';
import ap from '../images/culture1.jpg';

const App = () => {
  const stateList = [
    { _id: 1, name: 'Andhra Pradesh', culture: 'abc', dress: '...', food: '...', festivals: '...', temples: '...' },
    { _id: 2, name: 'Maharashtra', culture: '...', dress: '...', food: '...', festivals: '...', temples: '...' },
    // Add more states
  ];

  return (
    <>
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/heritagesites" element={<HeritageSites />} />
        <Route path="/travelwithus" element={<TravelWithUs />} />
        <Route path="/gallery" element={<Gallery />} />
        <Route path="/ourpride" element={<OurPride />} />
        <Route path="/blog" element={<Blog />} />
        <Route path="/signup" element={<SignUp />} />
        <Route path="/signin" element={<SignIn />} />
        <Route path="/StateList" element={<StateList />} />
        <Route path="/state/:stateId" element={<StateDetails stateList={stateList} />} />

      </Routes>
    </>
  );
};

export default App;
